import Login from "./Login";
import Logout from "./Logout";
import MainPage from "./MainPage";

function NavigationPanel(props) {
    return (
    <div>
        <nav>{props.connect ? <Logout logout={props.logout} /> : <Login login={props.login}/>}</nav>
        <form method="POST" action="">
            <label htmlFor="username">Login</label><input type="text" id="username" onChange={setId}></input><br/>
            <label htmlFor="mdp">Mot de passe</label><input type="password" id="mdp" onChange={setMdp}></input><br/>
            <button type="submit" onClick={login}>Log In</button><button type="reset">Annuler</button>
        </form>
    </div>);
}

export default NavigationPanel
